tables.table_schema:
CREATE TABLE ProteinStructures (
    protein_id INT PRIMARY KEY,
    structure_type VARCHAR(50),
    resolution FLOAT
);

CREATE TABLE ProteinInteractions (
    interaction_id INT PRIMARY KEY,
    protein_id_1 INT,
    protein_id_2 INT,
    interaction_type VARCHAR(50)
);

CREATE TABLE ProteinStructure (
    protein_id UUID PRIMARY KEY,
    structure TEXT,
    resolution DOUBLE
);

CREATE TABLE ProteinInteractions (
    interaction_id UUID PRIMARY KEY,
    protein_id1 UUID,
    protein_id2 UUID,
    interaction_type TEXT
);

CREATE TABLE ProteinAnnotations (
    annotation_id UUID PRIMARY KEY,
    protein_id UUID,
    annotation TEXT
);

CREATE TABLE Protein {
  ProteinID INT PRIMARY KEY,
  ProteinName VARCHAR(255),
  ProteinDescription TEXT
}

CREATE TABLE Structure {
  StructureID INT PRIMARY KEY,
  StructureName VARCHAR(255),
  ProteinID INT,
  FOREIGN KEY (ProteinID) REFERENCES Protein(ProteinID)
}

CREATE TABLE Interaction {
  InteractionID INT PRIMARY KEY,
  InteractionType VARCHAR(100),
  StructureID INT,
  FOREIGN KEY (StructureID) REFERENCES Structure(StructureID)
}

CREATE TABLE InteractionDetail {
  DetailID INT PRIMARY KEY,
  InteractionID INT,
  InteractionDescription TEXT,
  FOREIGN KEY (InteractionID) REFERENCES Interaction(InteractionID)
}
